with fk_table as (
 select
 {{fk_columns_csv}}
 from {{model}}
 where 1=1
 {% for column in fk_columns_list -%}
 and {{column}} is not null
 {% endfor %}
),

pk_table as (
 select
 {{pk_columns_csv}}
 from {{pk_table_name}}
